59247146.css:
body { font-family: Arial, sans-serif; color: #1a1a1a; margin: 0;}
h1, h2, h3, h4, h5, h6 { margin: 0; font-size: 1em;}
h1 { font-size: 2em; font-weight: normal;}
a { color: #a1b24e; text-decoration: none;}
a.button { color: #3C3C3C; text-align: center; font-size: 1.25em; line-height: 2.6em; font-weight: bold; text-shadow: 0 1px 0 white; display: block; margin-bottom: 1em; border: 1px solid #b0b0b0; box-shadow: inset 0 1px 0 rgba(255,255,255,0.7); background: #dbdbdb; background: -moz-linear-gradient(top, #ebebeb, #dbdbdb); background: -webkit-gradient(linear, left top, left bottom, from(#ebebeb), to(#dbdbdb)); filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#ebebeb', endColorstr='#dbdbdb'); border-radius: 0.5em;}
a.button img { height: 1.6em; vertical-align: middle; margin-right: 0.3em;}
.main { background: #ffffff; border: none; margin: 0.8em; padding: 0.8em;}
